import { ProductCard } from "./ProductCard";

interface Variants {
  price: number
}

interface Items {
  description: string,
  name: string,
  variants: Variants[]
}

interface Products {
  items: Items[]
}

interface Props {
  products: Products
}


export const ProductList = ({products}: Props): JSX.Element => {
  const {items} = products

  return (
    <section>
      {items && items.map(() => {
        return (
          <ProductCard></ProductCard>
        )
      })}
    </section>
  );
}
